[신년인터뷰] ⑫ 김지철 충남교육감 &quot;행정통합에 의견 개진할 것&quot;


**연합뉴스** | 2025-12-28 00:00 | 

---

&quot;특별법 발의 과정서 교육계 의견 수렴하지 않은 것 아쉬워&quot;&quot;남은 6개월도 지속 가능한 미래학교 실현 위해 최선 다할 것&quot;

(홍성&#x3D;연합뉴스) 김준범 기자 &#x3D; 김지철 충남교육감은 28일 &quot;학생 학습권 보호와 교육 공공성을 최우선에 두고 (대전과 충남 행정통합에) 적극적인 의견을 개전하면서 정책적 역할을 하겠다&quot;고 밝혔다

[인터뷰] &#x27;파친코&#x27; 이민진 작가 &quot;맘다니 뉴욕시장, 긍정적 변화 기대&quot;


**연합뉴스** | 2025-12-28 00:00 | 

---

7세때 뉴욕으로 이민…한국계로 유일하게 맘다니 취임위원회 위촉&quot;맘다니, 이민자·취약층 보호할 것…SNS·공동체붕괴가 정치양극화 초래&quot;

(뉴욕&#x3D;연합뉴스) 이지헌 특파원 &#x3D; 재미교포 작가 이민진(57)은 새해 1월 1일 뉴욕시장으로 취임하는 조란 맘다니(34) 뉴욕시장 당선인에 대해 &quot;맘다니 시장이 긍정적인 변화와 더 큰 혁신을 촉진할 것이라 믿는다&quot;라고 말했다

&#x27;노동 사각지대&#x27; 5인 미만·특고·플랫폼…&quot;노동위서 다뤄야&quot;


**연합뉴스** | 2025-12-28 00:00 | 

---

근로기준법 보호 못 받는 노동자들…중노위 가도 절반 기각·각하한국노동법학회 연구 보고서 &quot;노동위 보호 필요, 인적·물적 보강&quot;

(서울&#x3D;연합뉴스) 옥성구 기자 &#x3D; 근로기준법 등 법의 보호를 받지 못해 &#x27;노동 사각지대&#x27;로 불리는 5인 미만 사업장과 특수고용·플랫폼 노동자와 관련해 노동위원회가 역할을 해야 한다는 제언이 나왔다
